import React, {useState} from 'react';
import { IconButton } from '@mui/material';
import AddIcon from '@mui/icons-material/Add';




import ModalTemplate from '../../components/ModalComp';;

function LoadDataModal(props) {
    const [open, setOpen] = useState(false);

    const title = 'הוספת מערכת';
    const fabStyle = {
        margin: 0,
        top: 'auto',
        right: 'auto',
        bottom: 20,
        left: 20,
        position: 'fixed',
    };

    const makeTrigerBtn = (additionalProps) => {
        return (
            <IconButton 
                onClick={additionalProps.onClick} 
                style={fabStyle} 
                title='טען דאטא' 
                color='info'
            >
                <AddIcon/>
            </IconButton>
        )
    }

    const body = (
        <div>
            Load data
        </div>
    )

    return (
        <div>
            <ModalTemplate 
                closeBtn 
                body={body} 
                title={title} 
                closeTxt={'סגור'}
                makeTrigerBtn={makeTrigerBtn}
                openController={{open, setOpen}}
            />
        </div>
    );
}

export default LoadDataModal;
